import axios from "axios";
const API_URL = "http://localhost:8081/api/user";

class AuthService {
  login() {}
  logout() {}
  register(username, email, password) {
    return axios.post(API_URL + "/register", {
      username,
      email,
      password,
    });
  }
}

export default new AuthService();
